extern crate rand; use rand::distributions::{IndependentSample, Range}; /// Right-to-left modular exponentiation implementation
/// For more information see https://en.wikipedia.org/wiki/Modular_exponentiation
fn modular_exponentiation(base: u64, exponent: u64, modulus: u64) -> u64 { let mut result = 1; let mut e = exponent; let mut b = base; while e > 0 { if (e & 1) == 1 { result = (result * b) % modulus; } e >>= 1; b = (b * b) % modulus; } result
} pub fn private_key(p: u64) -> u64 { Range::new(2, p).ind_sample(&mut rand::thread_rng())
} pub fn public_key(p: u64, g: u64, a: u64) -> u64 { modular_exponentiation(g, a, p)
} pub fn secret(p: u64, b_pub: u64, a: u64) -> u64 { modular_exponentiation(b_pub, a, p)
}

