use std::io::{Read, Result, Write}; pub struct WriteStats<W: Write> { inner: W, bytes: usize, writes: usize,
} impl<W: Write> WriteStats<W> { pub fn new(wrapped: W) -> WriteStats<W> { WriteStats { inner: wrapped, bytes: 0, writes: 0, } } pub fn get_ref(&self) -> &W { &self.inner } pub fn bytes_through(&self) -> usize { self.bytes } pub fn writes(&self) -> usize { self.writes }
} impl<W: Write> Write for WriteStats<W> { fn write(&mut self, buf: &[u8]) -> Result<usize> { self.writes += 1; let written = self.inner.write(buf)?; self.bytes += written; Ok(written) } fn flush(&mut self) -> Result<()> { self.inner.flush() }
} pub struct ReadStats<R: Read> { inner: R, bytes: usize, reads: usize,
} impl<R: Read> ReadStats<R> { pub fn new(wrapped: R) -> ReadStats<R> { ReadStats { inner: wrapped, bytes: 0, reads: 0, } } pub fn get_ref(&self) -> &R { &self.inner } pub fn bytes_through(&self) -> usize { self.bytes } pub fn reads(&self) -> usize { self.reads }
} impl<R: Read> Read for ReadStats<R> { fn read(&mut self, buf: &mut [u8]) -> Result<usize> { self.reads += 1; let read = self.inner.read(buf)?; self.bytes += read; Ok(read) }
}

