) -> Result<Vec<Digit>, Error> { // check that both bases are in the correct range if from_base < 2 { return Err(Error::InvalidInputBase); } if to_base < 2 { return Err(Error::InvalidOutputBase); } // check that all digits are in the correct range specified by the base if let Some(&invalid) = digits.as_ref().iter().find(|&num| *num >= from_base) { return Err(Error::InvalidDigit(invalid)); } // convert all digits into a single large number let mut immediate = digits .as_ref() .iter() .rev() .enumerate() .map(|(i, &num)| num * from_base.pow(i as u32)) .fold(0, |accu, num| accu + num); // convert number into digits let mut res = Vec::new(); while immediate > 0 { res.push(immediate % to_base); immediate /= to_base; } // fix order of digits res.reverse(); Ok(res)
}

