#[derive(Debug, PartialEq)]
pub enum Error { IncompleteNumber, Overflow,
} /// Convert a list of numbers to a stream of bytes encoded with variable length encoding.
pub fn to_bytes(values: &[u32]) -> Vec<u8> { let mut res = vec![]; for value in values { res.append(&mut to_bytes_single(*value)); } res
} fn to_bytes_single(mut value: u32) -> Vec<u8> { // over allocates, but avoids growth let mut res = Vec::with_capacity(4); // 0 must be handled specially, because we need to push one byte if value == 0 { return vec![0]; } while value > 0 { // take the lower 7 bits let mut tmp = (value & 0x7f) as u8; // remove them from the original value value >>= 7; // set continuation bit if !res.is_empty() { tmp |= 0x80; } res.push(tmp); } // order is wrong due to the way we pushed the data onto it res.reverse(); res
} // Alternative solution with hardcoded borders
