pub fn from_bytes(bytes: &[u8]) -> Result<Vec<u32>, Error> { let mut res = vec![]; let mut tmp = 0; for (i, b) in bytes.iter().enumerate() { // test if first 7 bit are set, to check for overflow if (tmp & 0xfe_00_00_00) > 0 { return Err(Error::Overflow); } // append bytes of b to tmp tmp = (tmp << 7) | (b & 0x7f) as u32; if 0x80 & b == 0 { // continuation bit not set, number if complete res.push(tmp); tmp = 0; } else { // check for incomplete bytes if i + 1 == bytes.len() { // the next index would be past the end, // i.e. there are no more bytes. return Err(Error::IncompleteNumber); } } } Ok(res)
}

