"; /// In The White Night
/// A poem by Alexander Blok(https://en.wikipedia.org/wiki/Alexander_Blok)
/// a Russian poet who is regarded as one of the most important figures of the Silver Age of Russian Poetry
/// You can read the translation here: https://lyricstranslate.com/ru/белой-ночью-месяц-красный-white-night-crimson-crescent.html
static IN_THE_WHITE_NIGHT_CONTENT: &'static str = "Белой ночью месяц красный
Выплывает в синеве.
Бродит призрачно-прекрасный,
Отражается в Неве.
Мне провидится и снится
Исполпенье тайных дум.
В вас ли доброе таится,
Красный месяц, тихий шум?..
"; struct Fixture<'a> { file_names: &'a [&'a str],
} impl<'a> Fixture<'a> { fn new(file_names: &'a [&'a str]) -> Self { Fixture { file_names } } fn set_up(&self) { let file_name_content_pairs = self .file_names .iter() .cloned() .map(|file_name| { if file_name.ends_with("iliad.txt") { (file_name, ILIAD_CONTENT) } else if file_name.ends_with("midsummer_night.txt") { (file_name, MIDSUMMER_NIGHT_CONTENT) } else if file_name.ends_with("paradise_lost.txt") { (file_name, PARADISE_LOST_CONTENT) } else { (file_name, IN_THE_WHITE_NIGHT_CONTENT) } }) .collect::<Vec<(&str, &str)>>(); set_up_files(&file_name_content_pairs); }
} impl<'a> Drop for Fixture<'a> { fn drop(&mut self) { tear_down_files(self.file_names); }
} fn set_up_files(files: &[(&str, &str)]) { for (file_name, file_content) in files { fs::write(file_name, file_content).expect(&format!( "Error setting up file '{}' with the following content:\n{}", file_name, file_content )); }
} fn tear_down_files(files: &[&str]) { for file_name in files { fs::remove_file(file_name).expect(&format!("Could not delete file '{}'", file_name)); }
} /// This macro is here so that every test case had its own set of files to be used in test.
/// The approach is to create required files for every test case and to append test name to the
/// file names (so for test with a name 'test_one_file_one_match_no_flags' and a required file
/// 'iliad.txt' there would be created a file with a name
/// 'test_one_file_one_match_no_flags_iliad.txt').
/// This allows us to create files for every test case with no intersection between them.
///
/// A better way would be to create required set of files at the start of tests run and to
/// delete them after every test is finished, but there is no trivial way to create such
/// a test fixture in standard Rust, and Exercism restricts the usage of external dependencies
/// in test files. Therefore the above approach is chosen.
///
/// If you have an idea about a better way to implement test fixture for this exercise,
/// please submit PR to the Rust Exercism track: https://github.com/exercism/rust
macro_rules! set_up_test_case { ($(#[$flag:meta])+ $test_case_name:ident(pattern=$pattern:expr, flags=[$($grep_flag:expr),*], files=[$($file:expr),+], expected=[$($expected:expr),*])) => { $(#[$flag])+ fn $test_case_name() { let pattern = $pattern; let flags = vec![$($grep_flag),*]; let files = vec![$(concat!(stringify!($test_case_name), "_" , $file)),+]; let expected = vec![$($expected),*]; process_grep_case(&pattern, &flags, &files, &expected); } }; ($(#[$flag:meta])+ $test_case_name:ident(pattern=$pattern:expr, flags=[$($grep_flag:expr),*], files=[$($file:expr),+], prefix_expected=[$($expected:expr),*])) => { $(#[$flag])+ fn $test_case_name() { let pattern = $pattern; let flags = vec![$($grep_flag),*]; let files = vec![$(concat!(stringify!($test_case_name), "_" , $file)),+]; let expected = vec![$(concat!(stringify!($test_case_name), "_", $expected)),*]; process_grep_case(&pattern, &flags, &files, &expected); } }
