e { type Err = ParseErr; fn from_str(s: &str) -> Result<Self, Self::Err> { let lc = s.to_lowercase(); let mut iter = lc.chars(); let mut note = match iter.next() { Some(c) if 'a' <= c && 'g' >= c => Note { tonic: match c { 'a' => Root::A, 'b' => Root::B, 'c' => Root::C, 'd' => Root::D, 'e' => Root::E, 'f' => Root::F, 'g' => Root::G, _ => return Err(ParseErr::InvalidTonic), }, accidental: None, }, Some(_) => return Err(ParseErr::InvalidTonic), None => return Err(ParseErr::InvalidLength), }; match iter.next() { Some('b') => note.accidental = Some(Accidental::Flat), Some('#') => note.accidental = Some(Accidental::Sharp), Some(_) => return Err(ParseErr::InvalidAccidental), None => {} } if iter.next().is_some() { return Err(ParseErr::InvalidLength); } Ok(note) } } impl From<Semitone> for Note { fn from(s: Semitone) -> Self { Note { tonic: match s { Semitone::A | Semitone::ASharp => Root::A, Semitone::B => Root::B, Semitone::C | Semitone::CSharp => Root::C, Semitone::D | Semitone::DSharp => Root::D, Semitone::E => Root::E, Semitone::F | Semitone::FSharp => Root::F, Semitone::G | Semitone::GSharp => Root::G, }, accidental: match s { Semitone::ASharp | Semitone::CSharp | Semitone::DSharp | Semitone::FSharp | Semitone::GSharp => Some(Accidental::Sharp), _ => None, }, } } } impl From<Note> for Semitone { fn from(n: Note) -> Self { Semitone::from_i8( (SEMITONES + n.tonic.to_i8().unwrap() + n.accidental.map_or(0, |a| a.to_i8())) % SEMITONES, ).expect("must have valid semitone") } } impl AddAssign<Interval> for Note { fn add_assign(&mut self, rhs: Interval) { *self = Semitone::from_i8( (SEMITONES + Semitone::from(*self).to_i8().unwrap() + rhs.to_i8().unwrap()) % SEMITONES, ).unwrap() .into(); } } } #[derive(Debug)]
