} impl Decimal { fn new(digits: BigInt, decimal_index: usize) -> Decimal { let mut value = Decimal { digits: digits, decimal_index: decimal_index, }; value.reduce(); value } pub fn try_from(mut input: &str) -> Option<Decimal> { // clear extraneous whitespace input = input.trim(); // don't bother to trim extraneous zeroes // leave it to users to manage their own memory // now build a representation of the number to parse let mut digits = String::with_capacity(input.len()); let mut decimal_index = None; for ch in input.chars() { match ch { '0'...'9' | '-' | '+' => { digits.push(ch); if let Some(idx) = decimal_index.as_mut() { *idx += 1; } } '.' => { if decimal_index.is_some() { return None; } decimal_index = Some(0) } _ => return None, } } Some(Decimal::new( try_opt!(digits.parse::<BigInt>().ok()), match decimal_index { Some(idx) => idx, None => 0, }, )) } /// Add precision to the less-precise value until precisions match /// /// Precision, in this case, is defined as the decimal index. fn equalize_precision(mut one: &mut Decimal, mut two: &mut Decimal) { fn expand(lower_precision: &mut Decimal, higher_precision: &Decimal) { let precision_difference = (higher_precision.decimal_index - lower_precision.decimal_index) as usize; lower_precision.digits = &lower_precision.digits * pow(BigInt::from(10_usize), precision_difference); lower_precision.decimal_index += precision_difference; } if one.decimal_index < two.decimal_index { expand(&mut one, &two) } else if one.decimal_index > two.decimal_index { expand(&mut two, &one) } assert_eq!(one.decimal_index, two.decimal_index); } /// Eliminate extraneous trailing zeroes /// /// This reduces the decimal index, so that the raw values are easier to parse fn reduce(&mut self) { let extra_zeroes = self.digits .to_string() // produce a decimal representation .chars() .rev() // trailing values .take(self.decimal_index) // not counting past the decimal point .take_while(|&c| c == '0') // counting only `0` digits .count(); self.digits = &self.digits / pow(BigInt::from(10_usize), extra_zeroes); self.decimal_index -= extra_zeroes; }
} macro_rules! auto_impl_decimal_ops { ($trait:ident, $func_name:ident, $digits_operation:expr, $index_operation:expr) => { impl $trait for Decimal { type Output = Self; fn $func_name(mut self, mut rhs: Self) -> Self { Decimal::equalize_precision(&mut self, &mut rhs); Decimal::new( $digits_operation(self.digits, rhs.digits), $index_operation(self.decimal_index, rhs.decimal_index), ) } } };
} auto_impl_decimal_ops!(Add, add, |s, o| s + o, |s, _| s);
auto_impl_decimal_ops!(Sub, sub, |s, o| s - o, |s, _| s);
auto_impl_decimal_ops!(Mul, mul, |s, o| s * o, |s, o| s + o); macro_rules! auto_impl_decimal_cow { ($trait:ident, $func_name:ident, $digits_operation:expr, $return_type:ty) => { impl $trait for Decimal { fn $func_name(&self, other: &Self) -> $return_type { if self.decimal_index == other.decimal_index { $digits_operation(&self.digits, &other.digits) } else { // if we're here, the decimal indexes are unmatched. // We have to compare equal terms. // clone both sides so we can modify either of them as necessary. // not efficient, but whatever. let mut one = self.clone(); let mut two = other.clone(); Decimal::equalize_precision(&mut one, &mut two); one.$func_name(&two) } } } };
} auto_impl_decimal_cow!(PartialEq, eq, |a, b| a == b, bool);
auto_impl_decimal_cow!(Ord, cmp, |a: &BigInt, b: &BigInt| a.cmp(b), Ordering); impl PartialOrd for Decimal { fn partial_cmp(&self, other: &Decimal) -> Option<Ordering> { Some(self.cmp(other)) }
} impl fmt::Display for Decimal { fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { // get a representation of the pure digits, // left-padded with zeroes let digits = format!("{:0>width$}", self.digits, width = self.decimal_index); if self.decimal_index == digits.len() { write!(f, "0.{}", digits) } else if self.decimal_index == 0 { write!(f, "{}", digits) } else { let (before_index, after_index) = digits.split_at(digits.len() - self.decimal_index); write!(f, "{}.{}", before_index, after_index) } }
} #[cfg(test)]
mod tests { use super::*; #[test] fn test_display_temp() { for test_str in vec!["0", "1", "20", "0.3", "0.04", "50.05", "66.0006", "0.007"] { println!( "Decimal representation of \"{}\": {}", test_str, Decimal::try_from(test_str).expect("This should always become a decimal") ); assert_eq!( test_str, Decimal::try_from(test_str) .expect("This should always become a decimal") .to_string() ) } }
}

