use std::collections::HashSet; fn sort(word: &String) -> String { let mut sorted: Vec<char> = word.chars().collect(); sorted.sort(); sorted.into_iter().collect()
} pub fn anagrams_for<'a>(word: &str, inputs: &[&'a str]) -> HashSet<&'a str> { let lower = word.to_lowercase(); let sorted = sort(&lower); inputs .iter() .filter(|input| { let input_lower = input.to_lowercase(); lower != input_lower && sorted == sort(&input_lower) }) .cloned() .collect()
}

