type Domino = (u8, u8); #[derive(Debug)]
enum CheckResult { GotInvalid, // chain returned None Correct, ChainingFailure(Vec<Domino>), // failure to match the dots at the right side of one domino with // the one on the left side of the next LengthMismatch(Vec<Domino>), DominoMismatch(Vec<Domino>), // different dominoes are used in input and output
} fn normalize(d: &Domino) -> Domino { match d { &(m, n) if m > n => (n, m), &(m, n) => (m, n), }
} fn check(input: &[Domino]) -> CheckResult { let output = match dominoes::chain(input) { None => return GotInvalid, Some(o) => o, }; if input.len() != output.len() { return LengthMismatch(output); } else if input.len() == 0 { // and thus output.len() == 0 return Correct; } let mut output_sorted = output.iter().map(|d| normalize(d)).collect::<Vec<Domino>>(); output_sorted.sort(); let mut input_sorted = input.iter().map(|d| normalize(d)).collect::<Vec<Domino>>(); input_sorted.sort(); if input_sorted != output_sorted { return DominoMismatch(output); } // both input and output have at least 1 element // This essentially puts the first element after the last one, thereby making it // easy to check whether the domino chains "wraps around". let mut fail = false; { let mut n = output[0].1; let iter = output.iter().skip(1).chain(output.iter().take(1)); for &(first, second) in iter { if n != first { fail = true; break; } n = second } } if fail { ChainingFailure(output) } else { Correct }
} fn assert_correct(input: &[Domino]) { match check(&input) { Correct => (), GotInvalid => panic!("Unexpectedly got invalid on input {:?}", input), ChainingFailure(output) => panic!( "Chaining failure for input {:?}, output {:?}", input, output ), LengthMismatch(output) => { panic!("Length mismatch for input {:?}, output {:?}", input, output) } DominoMismatch(output) => { panic!("Domino mismatch for input {:?}, output {:?}", input, output) } }
} #[test]
